var game;
var gameLoaded = false;
var createOnLoaded = false;
var num = 0,falg = 0,num1 = 0
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    
    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        var bg = this.add.sprite(0, 0, 'bg').setOrigin(0, 0).setInteractive()
        var sea = this.add.sprite(0, 0, 'sea').setOrigin(0, 0).setDepth(1).setInteractive()
        sea.visible = 0
        var Titanic = this.add.sprite(0, 0, 'Titanic').setOrigin(0, 0).setDepth(1)
        var Titanic1 = this.add.sprite(0, 0, 'Titanic1').setOrigin(0, 0).setDepth(1)
        Titanic1.visible = 0
        var Titanic2 = this.add.sprite(0, 458, 'Titanic2').setOrigin(0, 0).setInteractive().setDepth(1)
        var iceberg = this.add.sprite(0, 0, 'iceberg2').setOrigin(0, 0).setDepth(1)
        var iceberg1 = this.add.sprite(0, 0, 'iceberg').setOrigin(0, 0).setDepth(1)
        iceberg1.visible = 0
        var iceberg2 = this.add.sprite(410, 378, 'iceberg1').setOrigin(0, 0).setInteractive().setDepth(1)
        var sea1 = this.add.sprite(302, 720, 'sea1').setInteractive().setDepth(1)
        var jack = this.add.sprite(185, 210, 'jack').setDepth(1)
        jack.visible = 0
        var jack1 = this.add.sprite(185, 210, 'jack1').setInteractive().setDepth(1)

        var hand  = this.add.sprite(240,580,'hand')
        hand.scaleX = 0.5
        hand.scaleY = 0.5
        hand.setDepth(12)
        this.tweens.add({
            targets:[hand],
            scaleX:0.6,
            scaleY:0.6,
            duration:400,
            callbackScope:this,
            onComplete:()=>{
                this.tweens.add({
                    targets:[hand],
                    scaleX:0.5,
                    scaleY:0.5,
                    duration:400,
                    callbackScope:this,
                    onComplete:()=>{
                        
                    }
                })
            }
        })
        var hand_interval = setInterval(() => {
            this.tweens.add({
                targets:[hand],
                scaleX:0.6,
                scaleY:0.6,
                duration:400,
                callbackScope:this,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[hand],
                        scaleX:0.5,
                        scaleY:0.5,
                        duration:400,
                        callbackScope:this,
                        onComplete:()=>{
                            
                        }
                    })
                }
            })
        }, 800);

        this.input.on('pointerdown',()=>{
            hand.destroy()
            clearInterval(hand_interval)
            this.input.off('pointerdown')
        },this)
        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);
        // var num = 1
        // var title = this.add.text(400, 50, 'Static Text Object', { fontFamily: 'bold italic', fontSize: 64, color: '#00ff00' });
        // setInterval(() => {
        //     num++
        //     title.text = num
        // }, 100);

        ;
        (
            () => {
                Titanic2.on('pointerdown', () => {
                    Titanic1.visible = 1
                    Titanic2.visible = 0
                    Titanic2.off('pointerdown')
                    num++
                }, this)
                sea1.on('pointerdown', () => {
                    sea.visible = 1
                    sea1.visible = 0
                    sea1.off('pointerdown')
                    num++
                }, this)
                jack1.on('pointerdown', () => {
                    jack.visible = 1
                    jack1.visible = 0
                    jack1.off('pointerdown')
                    num++
                }, this)
                iceberg2.on('pointerdown', (pointer) => {
                    iceberg1.visible = 1
                    iceberg2.visible = 0
                    iceberg2.off('pointerdown')
                    num++
                }, this)
                bg.on('pointerdown', (pointer) => {
                    num1++
                    if(num+num1<= 5){
                        var wrong = this.add.sprite(pointer.x, pointer.y, 'wrong')
                        wrong.setDepth(10)
                        this.tweens.add({
                            targets: [wrong],
                            angle: 10,
                            duration: 100,
                            callbackScope: this,
                            onComplete: () => {
                                this.tweens.add({
                                    targets: [wrong],
                                    angle: -10,
                                    duration: 100,
                                    callbackScope: this,
                                    onComplete: () => {
                                        wrong.destroy()
                                    }
                                })
                            }
                        })
                    }
                }, this)
                sea.on('pointerdown', (pointer) => {
                    num1++
                    if(num +num1 <= 5){
                        var wrong = this.add.sprite(pointer.x, pointer.y, 'wrong')
                        wrong.setDepth(10)
                        this.tweens.add({
                            targets: [wrong],
                            angle: 10,
                            duration: 100,
                            callbackScope: this,
                            onComplete: () => {
                                this.tweens.add({
                                    targets: [wrong],
                                    angle: -10,
                                    duration: 100,
                                    callbackScope: this,
                                    onComplete: () => {
                                        wrong.destroy()
                                    }
                                })
                            }
                        })
                    }
                }, this)
            }
        )()
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update() {
        if(num == 4 && falg == 0){
            this.input.off('pointerdown')
            setTimeout(() => {
                this.showDownload(4)
            }, 500);
            falg = 1
        }
        if(num+num1 == 5 && (num==1 || num1 ==2 || num1 == 3 || num1 ==4 || num1 == 5 )&&falg ==0){
            setTimeout(() => {
                this.showDownload(5)
            }, 500);
            falg = 1
        }
    }

    // 
    showDownload(n){
        this.tm = this.add.image(0,0,'bg').setOrigin(0,0).setInteractive()
        this.tm.alpha = 0.0001
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.85;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        if(n == 4){
            this.success = this.add.image(256,400,'success')
            this.success.scaleX = 0
            this.success.scaleY = 0
            this.success.setDepth(11)
            this.tweens.add({
                targets:[this.success],
                scaleX:1,
                scaleY:1,
                duration:400,
                callbackScope: this,
                onComplete: () => {
                    this.continue = this.add.image(256,500,'continue').setInteractive()
                    this.continue.setDepth(11)
                    this.continue.on('pointerdown',()=>{
                        landingPage()
                    },this)
                }
            })
        }
        if(n == 5){
            this.fail = this.add.image(256,400,'fail')
            this.fail.scaleX = 0
            this.fail.scaleY = 0
            this.fail.setDepth(11)
            this.tweens.add({
                targets:[this.fail],
                scaleX:1,
                scaleY:1,
                duration:400,
                callbackScope: this,
                onComplete: () => {
                    this.download = this.add.image(186,500,'download').setInteractive()
                    this.repty = this.add.image(326,500,'repty').setInteractive()
                    this.download.setDepth(11)
                    this.repty.setDepth(11)
                    this.download.on('pointerdown',()=>{
                        landingPage()
                    },this)
                    this.repty.on('pointerdown',()=>{
                        this.scene.start("PlayGame")
                    },this)
                }
            })
        }

    }


    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
